import { lazy } from 'react-router-guard';

const NewAd = lazy(() => import('./views/Pages/NewAd.js'));

//const DefaultLayout = React.lazy(() => import('./containers/DefaultLayout/DefaultLayout.js'));
const StudentsPage = React.lazy(() => import('./views/Pages/StudentsPage.js'));

// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config

export default  [
 // { authorize: ["ROLE_ADMIN"], path: '/users', component: Comments },
  { path: '/students', component: StudentsPage },

  //{ path: '/register', component: Register },
  //{ path: '/home', component: lazy(() => import('./containers/DefaultLayout')) },

];
